import { GoogleMap, LoadScript, Autocomplete } from '@react-google-maps/api';



const GoogleMaps = () => {

    const mapStyles = {
        height: "100vh",
        width: "100%"
    };

    const defaultCenter = {
        lat: 40.4165000, lng: -3.7025600
    }

    const onLoad = (autocomplete) => {
        console.log('autocomplete: ', autocomplete);
    }

    const onPlaceChanged = () => {
        console.log('Place changed');
    }

    return (
        <div>
            <h3>Encuentra centros de adopci√≥n cercanos</h3>
            <LoadScript googleMapsApiKey='AIzaSyDiT0oMbPlcoyQWL8eCXMiE71TmL1QYdOE'>
                <div>
                    <Autocomplete
                        onLoad={onLoad}
                        onPlaceChanged={onPlaceChanged}
                        restrictions={{ country: 'es', types: ['geocode'] }}
                        fields={['geometry.location']}
                        placeholder="Buscar lugares en Madrid"
                        componentRestrictions={{ administrativeArea: "Madrid" }}
                    />
                    <GoogleMap
                        mapContainerStyle={mapStyles}
                        zoom={13}
                        center={defaultCenter}
                    />
                </div>

            </LoadScript>
        </div>
    )
}

export default GoogleMaps
